import { Link } from "react-router-dom";
import "./NoPage.css";

function NoPage(){
    return(
        <div className="container flex">
            <header>Oops!</header>
            <section>
                <p>Sorry, you got lost in the black hole :P</p>
                <Link to={'/home'}>Back to home</Link>
            </section>
        </div>
    );
}
export default NoPage;
